import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom"
import SignUp from "./components/SignUp";
import Home from "./components/Home"
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/signup" element={<Home />}></Route>
        <Route exact path="/login" element={<Home />}></Route>
        <Route exact path="/you" element={<Home />}></Route>
      </Routes>
    </BrowserRouter>
    // <div className="App">
    //   <Home />
    // </div>
  );
}

export default App;
